def can_cut_h(r,c, s1, s2):
 if (s1 % r != 0) and (s2 % r != 0):
  return None
 c1, c2 = s1 / r, s2 / r
 if c1 + c2 != c:
  return None

 return c2

def can_cut_v(r,c, s1, s2):
 if (s1 % c != 0) and (s2 % c != 0):
  return None
 r1, r2 = s1 / c, s2 / c
 if r1 + r2 != r:
  return None

 return r2

